import React from "react";

export default function Checking() {
  let details = [
    {
      ExampleOfTreatmentAvailable: [
        {
          treatment: "Cancer Curative Treatment",
        },
        {
          treatment: "Sar Dard",
        },
        {
          treatment: "Stomatch Pain",
        },
        {
          treatment: "Brain",
        },
      ],
    },
  ];

  return <div>
    {details.map((item,index)=>{
      return <li key={index}>{item}</li>
    })}
  </div>;
}
